import React, { Component } from 'react';
import { Link } from "react-router-dom";


function NavItems() {
    const listItems = navitems.map((number) =>
    <li key={number.name}>{number.url}</li>
    );
    console.log(listItems);
    return (
    <ul>{listItems}</ul>
    );
}


class Navbar extends Component {
    constructor(props){
        super(props);
        console.log(NavItems);
        this.state = {
            navitems:[]
        } 
    }
    constnavitems = [
        {
            name: "Home",
            url : "/"
        },
        {
            name: "Login",
            url : "/login"
        },
        {
            name: "Signup",
            url : "/signup"
        },
        {
            name: "Profile",
            url : "/profile"
        }, 
        {
            name: "Logout",
            url : "/logout"
        }, 
    ];
    render() {
        return (
            <div>
                <ul>
                    {NavItems}
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/login">Login</Link>
                    </li>
                    <li>
                        <Link to="/signup">Signup</Link>
                    </li>
                </ul>

                <hr />

            </div>
        );
    }
}

export default Navbar;
